    "PublicRemarks": "Beautiful, one-of-a-kind, custom-built home located on the Grand River!  This 2,600+ sq.ft., architecturally designed home is like no other, nestled in a peaceful \u0026 private setting just minutes from the bustling downtown core.  Built in 2010, this home boasts modern amenities and is move-in ready. The first floor is open concept featuring handsome wide plank maple h/w flooring, 6ft. tall windows and a cozy gas fireplace. The gourmet chefs kitchen comes complete with granite counters, stainless steel appliances and center island with breakfast bar. Soaring 10 ft. ceilings extend up to the sunny 2nd floor landing with vaulted ceilings and skylights.  The two 2nd floor bedrooms are connected by a Jack \u0026 Jill bathroom, a great feature for teens or guests.   On the third floor you will find the oversized master suite and 4th bedroom which would also be the perfect spot for a home office, gym or media room. The master ensuite features a whirlpool tub, vessel sinks and exquisite views of the Grand.  2nd floor laundry, an oversized, attached 2 car garage and dry crawl space for ample storage make living in this home a dream.  Enjoy a glass of wine in the beautifully manicured front courtyard or enjoy the privacy of the fenced backyard oasis.  Stunning and lovingly maintained perennial gardens a hot tub for chilly nights and deck where you can relax and take in the sights of the Grand are just a few features of this great space.  This home has so much to offer? just come and see.",
